import React from 'react';
import {Link} from 'react-router-dom';

const Navbar =() =>{
    return (
        <>
        <Link >AboutUs</Link>
        <Link>Contact</Link>
        <a href="/">AboutUs</a>
        <a href="/contact">Contact</a>
        </>
    )
}

export default Navbar;
